const routes = [
	{
		path: "/buyer/dashboard",
		icon: "HomeIcon",
		name: "Dashboard",
	},
	{
		path: "/buyer/wishlist",
		icon: "FormsIcon",
		name: "Wishlist",
	},
	{
		path: "/buyer/history",
		icon: "HistoryIcon",
		name: "History",
	},
	{
		path: "/buyer/ratings",
		icon: "StarIcon",
		name: "Ratings",
	},
	{
		path: "/buyer/notifications",
		icon: "BellIconOutLined",
		name: "Notifications",
	},
	{
		path: "/buyer/profile",
		icon: "UserIcon",
		name: "Profile",
		profile: true,
	},
];

export default routes;
